import React from "react";

// Core Components
import NavBar from "./modules/NavBar";

export default function App()
{
    return (
        <>
            <div className="App" style={{ flexgrow: 1 }}>
                <NavBar />
                <body>
                    <section style={{ textAlign: "center", verticalAlign: "middle" }}>
                        <img src=""/>
                        <h1 >DAVID RYAN</h1>
                        <h2>Computer Science Student and Self-Taught Software Developer</h2>
                        <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/>
                        <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/>
                        <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/>
                        <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/>
                        <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/>
                        <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/>
                        <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/>
                        <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/> <br/>
                    </section>
                </body>
            </div>
        </>
    );
}
